import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="home">
      <h1>Controle de Obras</h1>
      <div>
      <button>Obras</button>
      </div>
      <div></div>

      <button>Detalhe Obras</button>
      <Link to="/">Volte para home page</Link>
    </div>
  );
}

export default Home;
